import React from 'react'
import { MDBContainer } from 'mdbreact';

const Textcovid2 = () => {
    return (
        <MDBContainer>
            <p className="text-left">

                <strong>อ่านข้อมูลเกี่ยวกับไวรัสโควิด 19 เพิ่มเติม</strong>
                <li href="https://www.sanook.com/health/20717/">ทำไมต่างประเทศรณรงค์ไม่ให้ใส่ “หน้ากากอนามัย” แล้วคนไทยควรใส่อยู่ไหม?</li>
                <li href="https://www.sanook.com/health/20629/">10 ข้อควรทำ เมื่อกลับจากประเทศเสี่ยงไวรัส “โควิด-19”</li>
                <li href="https://www.sanook.com/health/20657/">โควิด-19 (ไวรัสโคโรนา) vs ไข้หวัดธรรมดา ต่างกันอย่างไร?</li>
                <li href="https://www.sanook.com/health/21313/">วิธีกินฟ้าทะลายโจร ต้านหวัดอย่างไรให้ปลอดภัย พร้อมสรรพคุณฟ้าทะลายโจร</li>
                <li href="https://www.sanook.com/news/8084971/">ฟ้าทะลายโจรต้านไวรัสโคโรนาได้! สาธารณสุขเผยผลวิจัยในหลอดทดลอง แนะกินทันทีเมื่อมีไข้</li>
            </p>
        </MDBContainer>
    )
}

export default Textcovid2;
